          <Row>
          <MenuRight href="/">Home</MenuRight>
          <Button title="Entrar"  variant='primary'/>
          <Button title="Cadastrar-se" variant='primary' />
        </Row>
          </>}



      </Container>
    </Wrapper>
  );
};

